import React from "react";
import { useCart } from "./c";

export const Cart = () => {
  const { cart } = useCart();

  return (
    <div className="cart-container">
      <h3>Carrito de Reservas</h3>
      {cart.length === 0 ? (
        <p>No hay habitaciones en tu carrito.</p>
      ) : (
        <ul>
          {cart.map((room, index) => (
            <li key={index}>
              <img src={room.Imagenes} alt={room.Nombre_Habitacion} width="100" />
              <p>{room.Nombre_Habitacion}</p>
              <p>${room.Precio_Base}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};
